?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Этот, знаменитый по всему миру бренд, был основан в 1868 году друзьями Джонсом и Мозером. Качество часов можно определить по девизу компании «высокое мастерство из Шаффузы». С самого начала своей деятельности компания поставила перед собой достаточно сложную цель IWC хотела сама задавать новые тенденции и стандарты в изготовлении часов. На сегодняшний день можно считать, что компания достигла этой цели. Репетиры, запас хода, турбийон, вечный календарь этими и многими другими особенностями выделяются часы IWC. Стоит отметить, что качеству и надежности этих часов, доверяют и военные. В 1963 году IWC получила большой заказ от ВВС Германии на пилотские часы. Также очень знаменитой стала модель Aquatimer. Это были первые часы для дайвинга, выпущенные компанией IWC. Эта модель отличалась от многих других высокой водонепроницаемостью. Главным элементом их популярности стало то, что их надевал знаменитый Жак-Ив Кусто во время своего погружения. Часы IWC это высококачественные часы со смелым дизайном, многофунциональностью, и своим индивидуальным вкусом.</span></span></p>
 
